Kinkiet Hello - prawy
Polska marka oświetleniowa Chors proponuje kinkiet Hello prawy jako uzupełnienie wystroju Twojego wnętrza. Ta minimalistyczna lampa ścienna to praktyczny i elegancki dodatek – do domu i nie tylko. 
Zobacz, jakie parametry wyróżniają ten model i gdzie najlepiej prezentuje się kinkiet Hello. 

Kinkiet Hello prawy – dane techniczne
Kinkiet Hello prawy to ledowa lampa ścienna o następujących parametrach:

Dostępne kolory: czarny, śnieżnobiały; na zapytanie dostępny również ciepły biały, szary, grafit;
Lampa ma wbudowany zasilacz LED;
Dostępna barwa światła: ciepła biała (3000K), inne barwy na zapytanie;
Wymiary kinkietu razem z podstawą: szerokość: 50 cm; 
Odległość od ściany: 11 cm;
Źródło światła: zintegrowany LED 6,4W + 4,2W (w komplecie).

Reflektor Hello umieszczony na szerokiej podstawie i wąskim ramieniu jest stylową lampą uzupełniającą. Może podkreślić wybrane detale w pomieszczeniu lub stworzyć oczekiwany przytulny nastrój.
Kilka sztuk takich kinkietów sprawdzi się też w roli oświetlenia głównego nawet w średniej wielkości pomieszczeniu, generując mocne i ciepłe światło. Sprawdzi się tam, gdzie niezbędne jest nastrojowe oświetlenie. Więcej o szczegółach aranżacji przeczytasz poniżej.

Prawy kinkiet Hello w aranżacji
Marka Chors działa dzięki zaangażowaniu zdolnych polskich projektantów, którzy wykorzystując zdobycze tradycyjnego wzornictwa, łączą je z nowoczesnymi inspiracjami. W efekcie powstają ponadczasowe modele, takie jak prawy kinkiet Hello. 
Kinkiet, czyli lampa ścienna na ramieniu z regulowanym reflektorem, sprawdzi się w różnego rodzaju pomieszczeniach:

w mieszkaniach (na przykład salonie bądź sypialni);
w biurach (by doświetlić przestrzeń roboczą);
hotelach w pokojach oraz na korytarzu;
w muzeach i galeriach, gdzie niezbędne jest dobre punktowe oświetlenie. 

Wykorzystaj kinkiet Hello prawy w sypialni przy łóżku jako designerską i oryginalną lampkę nocną do czytania. A jeśli masz obszerny salon, podkreśl interesujące detale z pomocą kinkietu skierowanego punktowo w określonym kierunku.
Dowiedz się więcej i napisz do nas poprzez formularz kontaktowy. Doradzimy Ci podczas zakupów i pomożemy wybrać niezbędne produkty do stworzenia niepowtarzalnej aranżacji oświetleniowej.
